[asy]

unitsize(1 cm);

pair A, B, C, D, E;

A = (0,0);

B = (1,0);

C = B + dir(60);

D = C + 2*dir(120);

E = dir(120);

draw(A--B--C--D--E--cycle);

label("$A$", A, SW);

label("$B$", B, SE);

label("$C$", C, dir(0));

label("$D$", D, N);

label("$E$", E, W);

